import React, { useState } from 'react';
import { View, Text, Button } from 'react-native'

const TodoList = () => {

    const [title, setTitle] = useState('TodoList')
    return (
        <View>
            <Text>{title}</Text>
            <Button title='Change me' onPress={() => setTitle('My List')}/>
        </View>
    )
}

export default TodoList;
